import React from "react";
import "./index.css";
import Puzzle from "./Puzzle";

function App(){
return( 
    <>
        <h1 className="header">🎰 Web Game Slot Machine 🎰</h1>

        <div className="box_boundary">
            
        <Puzzle x="🎅" y="🐪" z="⏰"/>
        <Puzzle/>
        <Puzzle/>

        </div>


    </>    
);
}

export default App;
